import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import FutbolcuListesi from './components/FutbolcuListesi';
import PuanTablosu from './components/PuanTablosu';
import MacSonuclari from './components/MacSonuclari';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<PuanTablosu />} />
          <Route path="/futbolcular" element={<FutbolcuListesi />} />
          <Route path="/mac-sonuclari" element={<MacSonuclari />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
